interface Message {
  id: string
  author: 'user' | 'system' | 'assistant'
  content: string
  timestamp: string
}

const Message: React.FC<MessageProps> = ({ 
  id, 
  author, 
  content, 
  timestamp 
}) => {
  return (
    <div className="message-bubble">
      <div className="message-header">
        <span>{author}</span>
        <time>{timestamp}</time>
      </div>
      <div className="message-content">
        {content}
      </div>
    </div>
  )
}
